import "./news.scss";
import imG from './newimg.jpg'
import menu from './menu.jpg'

function News() {
  return (
    <>
      <div className="New-ctr">
          <img src={menu} alt="" className="menu"/>
      </div>
    </>
  );
}
export default News;
